	      var channel = args['channel'] || msg['channel'];
	      var meta = args['meta'] || args['metadata'];
	      var auth_key = args['auth_key'] || AUTH_KEY;
	      var cipher_key = args['cipher_key'];
	      var err = args['error'] || msg['error'] || function () {};
