	      PUB_QUEUE[add_msg]({
	        callback: jsonp,
	        url: url,
	        data: _get_url_params(params),
	        fail: function (response) {
	          _invoke_error(response, err);
	          publish(1);
	        },
	        success: function (response) {
	          _invoke_callback(response, callback, err);
	          publish(1);
	        },
	        mode: (post) ? 'POST' : 'GET'
	      });

	      // Send Message
	      publish();
