	      var callback = callback || args['callback'] || function () {};
	      var err = args['error'] || function () {};

	      if (!channelArg && !channelGroupArg) return error('Missing Channel or Channel Group');
	      if (!SUBSCRIBE_KEY) return error('Missing Subscribe Key');

